import React from 'react'
import styled from 'styled-components'


const SearchTab = styled.div`
    background-color: white;
    width: 12.5rem;
    border-color: #c0bcbc;
    border-width: 1px; 
    height: 50rem;
    margin-top: 5rem;
    margin-left: -18rem;
    position: fixed;
    border-right: #00a2ff;
    border-left: transparent;
    border-style: solid;
    border-bottom:transparent;
    border-top:transparent;
    padding: 2rem;
    display: flex;

`
const ColoredLine = styled.hr`
            color:#00a2ff;
            background-color: #00a2ff;
            height: 1px;
            display: flex;
            width: 10rem;
            align-self: center;
            margin-right: 1px;


`
const Title = styled.h1`
    font-size: 1.5rem;
    margin-left: 2rem;
    padding: -1rem;


`
const Category = styled.div`
    background-color: yellow;
    max-height: 20rem;

`
const CatList = styled.div`
    background-color: green;
    height:17.5rem;
    padding: 1rem;  
    width: 10rem;
    align-items: center;
`
const CatItemBtn = styled.button`
    font-size: 1rem;
    width:10rem;
    height:2.5rem;
    padding: 0.5rem;
    margin:0.5rem;

`

const Search= ()=>{
    return(
        <SearchTab>
            <Category>
                <Title>Categories</Title>
                <ColoredLine/>
                <CatList>
                    <CatItemBtn> Education</CatItemBtn >
                    <CatItemBtn> Tech</CatItemBtn >
                    <CatItemBtn> Economy</CatItemBtn >
                    <CatItemBtn> Sports</CatItemBtn >
                    <CatItemBtn> Other</CatItemBtn >
                </CatList>
            </Category>

        </SearchTab>
    )
}
export default Search
